import React from 'react';
import { cpus } from 'os';

const Card = (props) => {
    const cWidth = 485;
    const cHeight = 300;
    const cPadding = 10;
    const cHeadFoot = 0.1;

    return (
        <div class="card">
            <h5 class="card-header">
                header
            </h5>
            <div class="card-body">
                <h5 class="card-title">Card Title</h5>
                <p class="card-text">this is some text within a card body.</p>
            </div>
            <div class="card-footer">
                footer
            </div>
        </div>
    )
}

export default Card;
